
"use strict";

const URL = require("../config/urls");

class UserDeviceInfoResource {
    // POST /api/v1/userDevice
    createUserDevice(options, callback) {
      return this.apiClient._postRequest(URL.USER_DEVICE_INFO.USER_DEVICE, options, callback);
    }
  
    // PUT /api/v1/userDevice
    updateUserDevice(options, callback) {
      return this.apiClient._putRequest(URL.USER_DEVICE_INFO.USER_DEVICE, options, callback);
    }
  }
  module.exports = UserDeviceInfoResource;
  